import Square from "./Square";
import {squares} from './App';
function boardRow({ lowRange, highRange }) {
    return <div className="board-row">
    <Square value={squares[lowRange]} onSquareClick={() => handleClick(lowRange)}/>
    <Square value={squares[highRange-1]} onSquareClick={() => handleClick(highRange-1)}/>
    <Square value={squares[highRange]} onSquareClick={() => handleClick(highRange)}/>
  </div>
  }

export default boardRow;
